import React from "react";
import Todo from "../todo/Todo";

const TodoList = () => {
  return (
    <div>
      <h1>TodoList</h1>
      <Todo></Todo>
      <Todo></Todo>
      <Todo></Todo>
    </div>
  );
};

export default TodoList;
